import { Container } from '@mui/material';
import React from 'react';
import { Link } from 'react-router-dom';

const List = ({ addToCart }) => {
    const items = [
        {
          id: 1,
          name: 'Akác',
          description: 'Leírás Akác mézről',
          price: 1000,
          image: 'https://via.placeholder.com/200'
        },
        {
          id: 2,
          name: 'Gyógy',
          description: 'Leírás Gyógy mézről',
          price: 1200,
          image: 'https://via.placeholder.com/200'
        },
        {
          id: 3,
          name: 'Hárs',
          description: 'Leírás Hárs mézről',
          price: 1500,
          image: 'https://via.placeholder.com/200'
        },
        {
          id: 4,
          name: 'Virág',
          description: 'Leírás Virág mézről',
          price: 800,
          image: 'https://via.placeholder.com/200'
        },
        {
          id: 5,
          name: 'Repce',
          description: 'Leírás Repce mézről',
          price: 900,
          image: 'https://via.placeholder.com/200'
        }
      ];

  return (
    <Container maxWidth="lg">
      <Box className={classes.root}>
        <Typography variant="h4">Termékek</Typography>
        <Grid container>
          {items.map((type) => (
            <Grid item xs={12} sm={6} md={4} lg={3} key={type}>
              <Box className={classes.item}>
                <img className={classes.image} src="https://via.placeholder.com/200" alt={type} />
                <Typography variant="h6">{type}</Typography>
                <Typography variant="body1">Leírás</Typography>
                <Typography variant="h5">Ár: 1000 HUF</Typography>
                <Button variant="contained" color="warning" onClick={() => addToCart(type)}>
                  Kosárba
                </Button>
              </Box>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Container>
  );
};

export default List;
